import React from "react"

class Formcls extends React.Component{
    render(){
        return(
            <div>
                <form>
                    <label> Your Name :
                        <input type="text"/>
                    </label>
                    <label> Passcode :
                        <input type="password"/>
                    </label>

                    <button>SUBMIT HERE</button>
                </form>
            </div>
        )
    }
}

export default Formcls
